import React from "react";
import SportCarCard from "./SportCarCard";

function SportCarCollection( {sportCar, onDeleteSportCar} ) {

    const displaySportCar = sportCar.map((sport) => {
        return (
            < SportCarCard 
              sport= {sport}
              key= {sport.id}
              onDeleteSportCar
            />
        )
    })

    return (
        <div>
            {displaySportCar}
        </div>
    )
}

export default SportCarCollection;
